import { useState } from "react";

function Right() {
    const [numbers, setNumbers] = useState({ num1: 1, num2: 2 });
    const [temp, setTemp] = useState(true);
    let sum;
    const funk = (par) => {
        if (temp === true) {
            sum = par.num1 + par.num2;
            return <p>{sum}</p>;
        } else {
            console.log('error')
        }

    };



    return (
        <div>

            {
                setTimeout(funk(numbers), 3000)
            }

        </div>
    );
}

export default Right;
